  "text" : "Do you know the best way to appreciate #iKON rappers? \n\nListen to their songs while following the romanized lyrics. Listen how their intonation and their diction vary per verse. Listen to the ways each syllable is emphasized differently to bring different feelings.",
  "id" : 1125268433585655809,
